# 题目描述
## 给定一个非负整数数组 nums ，你最初位于数组的 第一个下标 。
## 数组中的每个元素代表你在该位置可以跳跃的最大长度。
## 你的目标是使用最少的跳跃次数到达数组的最后一个下标。
## 假设你总是可以到达数组的最后一个下标。
### 我的题解：
```class Solution {
public:
    int jump(vector<int>& nums) {
        int result = 0;
        int curDistance = 0;
        int nextDistance = 0;
        for (int i = 0; i < nums.size() - 1; i++) {
            nextDistance = max(nums[i] + i, nextDistance);
            if (i == curDistance) {
                curDistance = nextDistance;
                result++;
            }
        }
        return result;
    }
};
```
