Static variables and register variables are two types of variables in C with different storage durations and scopes.

Static Variables:

Storage Duration: Static variables have a static storage duration, which means they are allocated memory when the program starts and deallocated when the program terminates. They retain their values between function calls.

Scope: The scope of a static variable depends on where it is declared.

If declared inside a function (local static variable), it is only accessible within that function but retains its value between calls.

If declared outside all functions (global static variable), it is accessible only within the file where it is declared (file scope).

Initialization: Static variables are initialized to zero by default if not explicitly initialized.

Example of a local static variable:

void function() {
    static int count = 0; // Local static variable
    count++;
    printf("Count: %d\n", count);
}

int main() {
    function(); // Output: Count: 1
    function(); // Output: Count: 2
    return 0;
}

Register Variables:

Storage Duration: Register variables have automatic storage duration, meaning they are allocated when the block they are declared in is entered and deallocated when the block is exited. However, the register keyword is a hint to the compiler to store the variable in a CPU register for faster access, but the compiler may ignore this request.

Scope: Register variables have block scope, meaning they are only accessible within the block they are declared in.

Initialization: Register variables are not initialized by default and must be explicitly initialized.

